import React from "react";
import "./PollingScreen.styles.css";

const PollingScreen = ()=>{
    return(
        <div className="container">
            <div className="polling-list">
            <h2>Which is your favourite framework?</h2>
            <form>
                <label><input type="radio" value="Vanilla JS" />Vanilla JS</label>
                <label><input type="radio" value="Angular JS" />Angular JS</label>
                <input type="radio" value="React JS" />
                <input type="radio" value="Vue JS" />

            </form>
            </div>
            <button type="submit">Submit Vote!</button>
        </div>
    )
}



export default PollingScreen;
